import React, { useEffect, useState } from 'react';
import axios from 'axios';
import ApexCharts from 'apexcharts';
import ReactApexChart from 'react-apexcharts';

const StackedBarChart = () => {
  const [chartData, setChartData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://127.0.0.1:8000/api/Items/');
        const data = response.data;

        // Extract the state counts and assigned users from the API response
        const stateCountsByUser = data.reduce((acc, item) => {
          const user = item.assigned_user;
          const state = item.feature_state;

          if (!acc[user]) {
            acc[user] = {};
          }

          if (!acc[user][state]) {
            acc[user][state] = 0;
          }

          acc[user][state] += 1;
          return acc;
        }, {});

        // Convert state counts to chart data format
        const chartData = Object.keys(stateCountsByUser).map((user) => ({
          name: user,
          data: Object.keys(stateCountsByUser[user]).map((state) => stateCountsByUser[user][state]),
        }));

        setChartData(chartData);
      } catch (error) {
        console.log(error);
      }
    };

    fetchData();
  }, []);

  const options = {
    chart: {
      type: 'bar',
      stacked: true,
    },
    xaxis: {
      categories: chartData[0]?.data || [], // Add null check here
    },
    plotOptions: {
      bar: {
        horizontal: true,
      },
    },
    legend: {
      position: 'right',
    },
    fill: {
      opacity: 1,
    },
  };

  return (
    <div className="stacked-bar-chart-container">
      <h2>Stacked Bar Chart - State Counts by Assigned User</h2>
      <ReactApexChart
        options={options}
        series={chartData}
        type="bar"
        height={350}
      />
    </div>
  );
};

export default StackedBarChart;






